import React from 'react';
import Notfound from './img/not-found.svg';

const NotFound = () => {
  return (
    <div className="not-found">
      <h2>Oops! Page not found.</h2>
      <div>
        <img src={NotFound} alt=""/>
      </div>
      <h4>We can't find the page you're looking</h4>
    </div>
  )
}

export default NotFound
